import React from "react";
import FundraisingProject from "./FundraisingProject";

const styles = {
    ul: {
        listStyle: 'none',
        margin: 0,
        padding: 0
    }
};

export default function FundraisingProjects() {

    return (
        <ul style={styles.ul}>
            <FundraisingProject/>
            <FundraisingProject/>
            <FundraisingProject/>
        </ul>
    );
}
